  `maintenance_date` text,
  `maintenance_title` text,
  `maintenance_report` text,
  `maintenance_st` text,
  `conformance_claim` varchar(200) DEFAULT NULL,
  `cctl` varchar(80) DEFAULT NULL,
  `remark` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3989 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
